// Favorites.jsx
import React from 'react';

const Favorites = ({ favorites }) => (
  <div>
    <h3>Favorites</h3>
    <ul>
      {favorites.map(favorite => (
        <li key={favorite.id}>
          <a href={`/content/${favorite.contentId}`}>{favorite.title}</a>
        </li>
      ))}
    </ul>
  </div>
);

export default Favorites;
